import React from 'react';
import logo from './logo.svg';
import './App.css';
import Individualmedicine from './medicines/Individualmedicine';
import { medicinedto } from './medicines/medicine.model';
import Medicinelist from './medicines/Medicinelist';

function App() {

  const testMedicinelist: medicinedto[] = [
    {
    id : 1,
    title : 'paracitamol',
    image_med : 'https://upload.wikimedia.org/wikipedia/commons/thumb/2/29/Paracetamol-skeletal.svg/220px-Paracetamol-skeletal.svg.png'
  },
  {
    id : 2,
    title : 'medicine 2',
    image_med : 'https://upload.wikimedia.org/wikipedia/commons/thumb/2/29/Paracetamol-skeletal.svg/220px-Paracetamol-skeletal.svg.png'

  }
];
  return (
    <>
    <h3>List of Medicines</h3>
    <Medicinelist medicines={testMedicinelist}/>
    </>
  )
}

export default App;
